import React from "react";
import {
  Card,
  Typography,
  Box,
  Grid,
  CardMedia,
  Button,
  CardContent,
  CardActionArea,
  Divider,
  Avatar,
} from "@mui/material";
const PostDetailsSkeleton = () => {
  const data = {
    title: "A new Basketball Game",
    details:
      "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Etiam sed erat sed sapien ultrices ultrices sed sed sapien ultrices ultrices sed",
    image:
      "https://images.unsplash.com/photo-1501785888041-af3ef285b470?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8f",
    tags: ["$kdjsfl"],
    creatorName: "Yash",
    createdOn: "2022-02-03",
    Location: "",
  };
  return (
    <Grid container spacing={4}>
      <Grid item xs={12} md={6}>
        <Card
          sx={{
            width: "auto",
            margin: "auto",
            borderRadius: "15px",
          }}
        >
          <CardMedia
            sx={{
              height: 0,
              paddingTop: "100%",
              backgroundColor: "rgba(0, 0, 0, 0.2)",
              backgroundBlendMode: "darken",
            }}
            image={
              data?.image ||
              "https://user-images.githubusercontent.com/194400/49531010-48dad180-f8b1-11e8-8d89-1e61320e1d82.png"
            }
            title={data?.title}
          />
        </Card>
      </Grid>
      <Grid item xs={12} md={6}>
        <Box
          sx={{
            height: "100%",
            width: "100%",
            display: "flex",
            flexDirection: "column",
            alignItems: "start",
            justifyContent: "center",
            marginBottom: 2,
            marginTop: 2,
          }}
        >
          <Box sx={{ marginTop: 1, display: "flex" }}>
            <Typography
              component={"h6"}
              variant={"body1"}
              sx={{ fontWeight: 600, whiteSpace: "nowrap" }}
            >
              Name :
            </Typography>
            <Typography sx={{ paddingLeft: 1, fontWeight: 500 }}>
              {` ${data?.title}`}
            </Typography>
          </Box>
          <Box
            sx={{
              marginTop: 1,
              display: "flex",
            }}
          >
            <Typography sx={{ fontWeight: 600 }}>Creator :</Typography>
            <Typography sx={{ paddingLeft: 1 }} variant="body1">
              {`${data?.creatorName}`}
            </Typography>
          </Box>
          <Box
            sx={{
              marginTop: 1,
              display: "flex",
            }}
          >
            <Typography variant="body1" sx={{ fontWeight: 600 }}>
              Created On :
            </Typography>
            <Typography
              sx={{ paddingLeft: 1 }}
              variant="body1"
            >{`${data.createdOn}`}</Typography>
          </Box>
          <Box
            sx={{
              marginTop: 1,
              display: "flex",
            }}
          >
            <Typography
              sx={{ fontWeight: 600, whiteSpace: "nowrap" }}
              variant="body1"
            >{`Tags : `}</Typography>
            <Typography sx={{ paddingLeft: 1 }}>
              {data?.tags?.join(" ")}
            </Typography>
          </Box>
          <Box
            sx={{
              marginTop: 1,
              display: "flex",
            }}
          >
            <Typography sx={{ whiteSpace: "nowrap", fontWeight: 600 }}>
              {`Location :`}
            </Typography>
            <Typography sx={{ paddingLeft: 1 }} variant="body1">
              {data?.location}
            </Typography>
          </Box>
        </Box>
      </Grid>
      <Grid item sx={12}>
        <Box
          sx={{
            marginTop: 1,
            display: "flex",
          }}
        >
          <Typography sx={{ whiteSpace: "nowrap", fontWeight: 600 }}>
            {`Details :`}
          </Typography>
          <Typography
            textAlign={"justify"}
            sx={{ paddingLeft: 1 }}
            variant="body1"
          >
            {data?.details}
          </Typography>
        </Box>
        <Divider textAlign="left" sx={{ color: "black", marginTop: 2 }}>
          <Typography variant="h6">
            {data?.adventureParticipantsCount} Participant(s)
          </Typography>
        </Divider>
      </Grid>

      {data?.adventureParticipants.map((user) => (
        <Grid item xs={12} md={6}>
          <Card
            sx={{
              width: "100%",
            }}
          >
            <CardActionArea>
              <CardContent
                sx={{
                  marginX: 1,
                }}
                onClick={() => console.log("Clicked")}
              >
                <Box
                  sx={{
                    display: "flex",
                    alignItems: "center",
                    overflow: "hidden",
                  }}
                >
                  <Avatar>
                    {user.userName.split(" ")[0][0]}
                    {user.userName.split(" ")[1][0]}
                  </Avatar>
                  <Box
                    sx={{
                      marginLeft: 1,
                      display: "block",
                      overflow: "hidden",
                    }}
                  >
                    <Typography noWrap variant={"h6"}>
                      {user?.userName}
                    </Typography>
                    <Typography noWrap>
                      {user?.userId === data?.createdBy
                        ? "creator"
                        : "participant"}
                    </Typography>
                  </Box>
                </Box>
              </CardContent>
            </CardActionArea>
          </Card>
        </Grid>
      ))}
    </Grid>
  );
};

export default PostDetailsSkeleton;
